import { Route,Routes } from "react-router-dom"
import Kartica from "./components/Kartica"
import Pocetna from "./Pocetna"

export default function App() {
  return (
    <Routes>
      <Route path="/" element={<Pocetna/>}/>
      <Route path="/igor" element={Kartica}/>
    </Routes>
    )
}
